import axios from "axios";

let userRegion = localStorage.getItem("userRegion");

const fetchReportsTypeByPlayerNickname = (nickname) => {
    const url = 'http://localhost:8080/api/v1/players/reportsType?username='+nickname+'&region='+userRegion;
    return axios.get(url).then(
        (response) => {
            return response.data;
        })
        .catch(error => {
            console.log(error)
        });
};

const fetchAllReportsType = () => {
    const url = "http://localhost:8080/api/v1/reportType/all?region="+userRegion;
    return axios.get(url).then(
        (response) => {
            return response.data;
        })
        .catch(error => {
            console.log(error)
        });        
};
export default {
    fetchReportsTypeByPlayerNickname,
    fetchAllReportsType,
}
